import './Projects.css';
import ProjectTile from './ProjectTile';

const Projects = () => {

    const projects = ["Pedali", "UT Skate Spots", "Photo Viewer Reborn"]

	return (
		<div className="projects">
            {
                projects.map(projectName => {
                    <ProjectTile title={projectName} />
                })
            }
		</div>
	)
}

export default Projects;
